import React, { Component } from 'react';
import AdminLogin from '../auth/AdminLogin';
import AdminProfile from '../auth/AdminProfile';

class AdminView extends Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }

    render() {
        return (
            <div>
                {!this.props.aUser && <AdminLogin changeUser={(e) => this.props.changeUser(e)} />}
                {this.props.aUser && <AdminProfile user={this.props.aUser} />}

            </div>
        )
    }
}

export default AdminView;
